Kecamatan Jatiasih bersama KUA Kecamatan Jatiasih menggelar seleksi Tilawatil Qur'an tahun 2025, yang diikuti oleh peserta dari berbagai usia, mulai dari anak-anak hingga dewasa. Seleksi ini bertujuan untuk mencari bakat terbaik dalam membaca Al-Qur'an dan meningkatkan kesadaran masyarakat akan pentingnya mempelajari dan mengamalkan ajaran Islam.

Peserta seleksi Tilawatil Qur'an ini terdiri dari tiga kategori, yaitu kategori anak-anak, remaja, dan dewasa. Mereka akan bersaing dalam membaca Al-Qur'an dengan tartil dan tajwid yang baik, serta menunjukkan kemampuan mereka dalam memahami dan mengamalkan ajaran Islam.

Seleksi ini diharapkan dapat meningkatkan kesadaran masyarakat akan pentingnya mempelajari dan mengamalkan ajaran Islam, serta kesempatan untuk mewakili Kecamatan Jatiasih dalam seleksi Tilawatil Qur'an tingkat kota atau provinsi.

