Selain jalan sehat dan senam bersama, acara ini juga dimeriahkan dengan berbagai lomba menarik, seperti lomba cerdas cermat Linmas dan lomba karaoke. Lomba cerdas cermat Linmas telah diumumkan sebelumnya, dan pemenang lomba ini akan menerima hadiah yang menarik

