Jatiasih, 15 Agustus 2025 ‚Äì Wajah-wajah penuh semangat tampak terpancar dari 30 siswa-siswi terpilih dari perwakilan SMP SHIDQIA ISLAMIC SCHOOL yang berdiri tegak di aula Kantor Kecamatan Jatiasih. Dengan seragam putih yang rapi dan tatapan mantap, mereka mengikrarkan janji untuk mengemban tugas mulia mengibarkan Sang Saka Merah Putih pada Upacara Peringatan HUT RI ke-80, 17 Agustus 2025 mendatang.
Bapak Camat Jatiasih, didampingi Tiga Pilar Kecamatan Jatiasih,Lurah Se-kecamatan Jatiasih,Serta pemangku Jabatan Dilingkup kecamatan Jatiasih, secara resmi mengukuhkan Pasukan Pengibar Bendera (Paskibra) Kecamatan Jatiasih Tahun 2025 dalam upacara Pengukuhan Pasukan Pengibar bendera dengan khidmat yang disaksikan oleh para pelatih, kepala sekolah dan guru pendamping, serta undangan lainnya.
Pengukuhan ini menandai kesiapan para anggota Paskibra yang telah melalui seleksi dan latihan intensif selama kurang lebih satu bulan. Dengan dedikasi dan disiplin tinggi, mereka dipersiapkan untuk menjalankan peran penting pada puncak peringatan kemerdekaan di Lapangan Kecamatan Jatiasih.
Dalam sambutannya, Camat Jatiasih menyampaikan rasa bangga dan terima kasih kepada para pelatih yang tanpa lelah membimbing adik-adik Paskibra, serta memberikan motivasi kepada seluruh anggota yang baru saja dikukuhkan.
Tugas yang akan kalian jalankan bukan hanya sekadar mengibarkan bendera, tetapi juga mengangkat semangat persatuan dan kebanggaan bangsa. Laksanakan tugas ini dengan hati, karena momen ini akan menjadi sejarah dalam hidup kalian, ujar Camat Jatiasih.
Suasana haru bercampur bangga menyelimuti acara ketika prosesi pengukuhan berlangsung. Dengan langkah tegap dan sorot mata penuh keyakinan, para anggota Paskibra menunjukkan kesiapan mereka untuk mengharumkan nama Kecamatan Jatiasih.
Selamat kepada seluruh anggota Paskibra SMP SHIDQIA ISLAMIC SCHOOL Kecamatan Jatiasih Tahun 2025. Kobarkan semangat juang, junjung tinggi kehormatan, dan jayalah selalu Indonesiaku.

