CAMAT JATIASIH MENERIMA KUNJUNGAN WALI KOTA BEKASI DI TAMAN EDUKASI POJOK 3R RW 09 JATISARI

Selasa, 5 Agustus 2025, Camat Jatiasih Ashari, S.T., M.M. Lurah Se-Kecamatan Jatiasih menerima kunjungan Wali Kota Bekasi, Dr. Tri Adhianto Tjahyono, di Taman Pojok Edukasi 3R dan Tempat Pengelolaan Sampah (TPS) 3R RW 09, Kelurahan Jatisari.

Dalam kunjungan singkat tersebut, Wali Kota Bekasi mendengarkan langsung paparan dari pengurus TPS 3R terkait perjalanan panjang pengelolaan sampah di wilayah Jatisari, mulai dari upaya awal menampung sampah untuk kemudian diangkut ke Bantar Gebang, hingga terobosan membangun tungku pembakaran, dan inovasi menuju zero waste dengan memanfaatkan limbah menjadi produk bermanfaat. Inovasi tersebut meliputi pengolahan sampah menjadi biogas, bahan bakar pengganti BBM, serta pemanfaatan residu pembakaran menjadi conblock untuk mempercantik lingkungan.

Usai paparan, Wali Kota Bwkasi langsung meninjau area pengolahan dan memberikan arahan. Ia menekankan pentingnya penyusunan konsep yang jelas dan terukur agar bisa diselaraskan dengan program dan anggaran Kota Bekasi. Wali Kota juga menyoroti bahwa produk hasil pengolahan sampah belum dapat dibeli oleh pemerintah daerah karena keterbatasan regulasi pertanggung jawaban. Oleh karena itu, kolaborasi dengan CSR (Corporate Social Responsibility) menjadi opsi strategis dalam mendukung keberlanjutan inovasi tersebut.

Selesai kegiatan, momen kunjungan dimanfaatkan oleh para hadirin dan warga sekitar untuk berfoto bersama Wali Kota Bekasi sebagai bentuk apresiasi dan kenang-kenangan.

