Camat Jatiasih, Ashari, S.T., M.M., menghadiri acara Pembukaan Pos UKK (Upaya Kesehatan Kerja) yang diinisiasi Dinas Kesehatan Kota Bekasi, Pos UKK ini dibentuk di TPS 3R Taman Edukasi Pojok 3R RW 09 Bumi Dirgantara Permai, sebagai upaya meningkatkan pelayanan kesehatan kerja bagi para karyawan dan pekerja di sektor pengelolaan sampah.

Pos UKK akan memberikan layanan pemeriksaan kesehatan dasar rutin setiap bulan, seperti pengecekan berat badan, tinggi badan, tekanan darah, serta edukasi kesehatan, bekerja sama dengan UPTD Puskesmas Jatisari.

Dalam sambutannya, Camat Jatiasih, Ashari, S.T., M.M., menyampaikan apresiasi dan kebanggaannya atas keberhasilan dan kemandirian TPS 3R RW 09 yang selama ini telah menjadi kebanggaan warga dan percontohan pengelolaan sampah mandiri di Kota Bekasi. Beliau menegaskan bahwa pengelolaan sampah yang tertib, mandiri, dan ramah lingkungan seperti ini sangat mendukung kebijakan Wali Kota Bekasi dalam penanganan sampah modern melalui sanitary landfill dan pengelolaan terpadu agar tidak ada lagi sampah dibuang sembarangan.

Camat juga menjelaskan bahwa keberhasilan TPS 3R RW 09 ini telah menarik banyak perhatian dan kunjungan dari berbagai pihak, mulai dari Kementerian Lingkungan Hidup, Bappenas, DPR RI, TNI, Universitas hingga kunjungan terbaru dari Sekretaris Daerah Kota Sukabumi Ini membuktikan bahwa TPS 3R RW 09 mampu menjadi percontohan di tingkat kota bahkan nasional.

Beliau berharap dengan hadirnya Pos UKK, perhatian pemerintah terhadap kesehatan dan keselamatan kerja para pekerja semakin nyata. Camat Jatiasih berpesan agar Pos UKK tidak hanya sekadar seremonial pembukaan, tetapi benar-benar dilaksanakan secara rutin, konsisten, dan berkelanjutan, bersama Puskesmas Jatisari dan dukungan penuh RW serta masyarakat. Dengan begitu, kesehatan para pekerja tetap terjamin dan produktivitas kerja semakin meningkat.

