Tahukah kamu, apa yang dimaksud Gratifikasi?

Gratifikasi adalah semua pemberian yang diterima oleh Pegawai Negeri atau Penyelenggara Negara (Pn/PN). Oleh karena itu gratifikasi memiliki arti yang netral, sehingga tidak semua gratifikasi merupakan hal yang dilarang atau sesuatu yang salah.

Gratifikasi adalah ‚Äúpemberian dalam arti luas yang meliputi pemberian uang, barang, rabat (diskon), komisi, pinjaman tanpa bunga, tiket perjalanan, fasilitas penginapan, perjalanan wisata, pengobatan cuma-cuma, dan fasilitas lainnya. Gratifikasi tersebut baik yang diterima di dalam negeri maupun di luar negeri dan yang dilakukan dengan menggunakan sarana elektronik atau tanpa sarana elektronik‚Äù.

Penjelasan tersebut bersumber dari Pasal 12B UU No. 20/2001 tentang Perubahan atas UU No.31/1999 tentang Pemberantasan Tindak Pidana Korupsi (UU Tipikor).

Apa saja gratifikasi yang dilarang?
1. Gratifikasi yang diterima berhubungan dengan jabatan
2. Penerimaan tersebut dilarang oleh peraturan yang berlaku, bertentangan dengan kode etik, memiliki konflik kepentingan atau merupakan penerimaan yang tidak patut/tidak wajar.

